INSERT INTO `v1_85002a9b8d192e1d16d814f2231939d7749543850b097e9e43335b178e406cd0` VALUES (0.3, 0, 129811, 1, 6, "あたしも教官の仕事を\n頑張れば、あいつに\n喜んでもらえたり\nするのかな…", 0, 11, 0, 8, 6006);
